import React from "react";

const Tagline = () => {
  return (
    <div>
      <header
        id="header"
        className="header"
        style={{
          background: `linear-gradient((rgba(0, 0, 0, 0.3), rgba(0, 0, 0, 0.5))url("../assets/images/header-background.jpg"") center center no-repeat `,
        }}
      >
        <div className="header-content">
          <div className="container">
            <div className="row">
              <div className="col-lg-12">
                <div className="text-container">
                  <h1>
                    Your Satisfaction Our{" "}
                    <span id="js-rotating">Target, Mission, Priority</span>
                  </h1>
                  <p className="p-heading p-large">
                    Aria is a top consultancy company specializing in business
                    growth using online marketing and conversion optimization
                    tactics
                  </p>
                  <a className="btn-solid-lg page-scroll" href="#intro">
                    DISCOVER
                  </a>
                </div>
              </div>
            </div>
          </div>
        </div>
      </header>
    </div>
  );
};

export default Tagline;
